import React, { useState, useRef, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Webcam from 'react-webcam';
import {
  Container,
  Paper,
  Typography,
  Box,
  Button,
  Card,
  CardContent,
  LinearProgress,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions
} from '@mui/material';
import {
  Mic as MicIcon,
  MicOff as MicOffIcon,
  Stop as StopIcon,
  PlayArrow as PlayIcon,
  Android as AIIcon
} from '@mui/icons-material';

const Interview = () => {
  const navigate = useNavigate();
  const webcamRef = useRef(null);
  const mediaRecorderRef = useRef(null);
  const [isRecording, setIsRecording] = useState(false);
  const [isListening, setIsListening] = useState(false);
  const [currentQuestion, setCurrentQuestion] = useState('');
  const [questionNumber, setQuestionNumber] = useState(1);
  const [totalQuestions] = useState(5); // Mock total questions
  const [isProcessing, setIsProcessing] = useState(false);
  const [recordedChunks, setRecordedChunks] = useState([]); // eslint-disable-line no-unused-vars
  const [showEndDialog, setShowEndDialog] = useState(false);
  const [interviewComplete, setInterviewComplete] = useState(false); // eslint-disable-line no-unused-vars

  // Mock questions for demo
  const mockQuestions = [
    "Tell me about yourself and your background in software development.",
    "Can you explain a challenging project you've worked on and how you overcame the difficulties?",
    "What are your strengths and weaknesses as a developer?",
    "Why are you interested in this position?",
    "Do you have any questions for us?"
  ];

  useEffect(() => {
    // Start with first question
    setCurrentQuestion(mockQuestions[0]);
  }, [mockQuestions]);

  const startRecording = async () => {
    try {
      const stream = await navigator.mediaDevices.getUserMedia({
        audio: true,
        video: false // We'll use webcam separately for video
      });

      mediaRecorderRef.current = new MediaRecorder(stream, {
        mimeType: 'audio/webm'
      });

      mediaRecorderRef.current.ondataavailable = (event) => {
        if (event.data.size > 0) {
          setRecordedChunks(prev => [...prev, event.data]);
        }
      };

      mediaRecorderRef.current.onstop = () => {
        // Process the recording here
        handleAnswerProcessing();
      };

      mediaRecorderRef.current.start();
      setIsRecording(true);
      setIsListening(true);
    } catch (err) {
      console.error('Error starting recording:', err);
    }
  };

  const stopRecording = () => {
    if (mediaRecorderRef.current && isRecording) {
      mediaRecorderRef.current.stop();
      setIsRecording(false);
      setIsListening(false);
      setIsProcessing(true);

      // Stop all tracks
      mediaRecorderRef.current.stream.getTracks().forEach(track => track.stop());
    }
  };

  const handleAnswerProcessing = () => {
    // Simulate processing time
    setTimeout(() => {
      setIsProcessing(false);

      // Move to next question or end interview
      if (questionNumber < totalQuestions) {
        setQuestionNumber(prev => prev + 1);
        setCurrentQuestion(mockQuestions[questionNumber]);
      } else {
        setInterviewComplete(true);
        setShowEndDialog(true);
      }
    }, 3000); // 3 second processing simulation
  };

  const handleEndInterview = () => {
    setShowEndDialog(false);
    // In a real app, you'd navigate to results/feedback page
    navigate('/');
  };

  const webcamConstraints = {
    width: 640,
    height: 480,
    facingMode: 'user'
  };

  return (
    <Container component="main" maxWidth="lg" sx={{ mt: 2 }}>
      <Paper elevation={3} sx={{ p: 3 }}>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
          <Typography variant="h5" component="h1">
            AI Interview Session
          </Typography>
          <Chip
            label={`Question ${questionNumber}/${totalQuestions}`}
            color="primary"
            variant="outlined"
          />
        </Box>

        <Box sx={{ display: 'flex', gap: 3, flexDirection: { xs: 'column', md: 'row' } }}>
          {/* AI Interviewer Section */}
          <Card sx={{ flex: 1, minHeight: 400 }}>
            <CardContent sx={{ height: '100%', display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center' }}>
              <AIIcon sx={{ fontSize: 80, color: 'primary.main', mb: 2 }} />
              <Typography variant="h6" align="center" gutterBottom>
                AI Interviewer
              </Typography>
              <Typography variant="body2" color="text.secondary" align="center" sx={{ mb: 3 }}>
                Virtual interviewer powered by advanced AI
              </Typography>

              {/* Question Display */}
              <Box sx={{ p: 2, bgcolor: 'grey.50', borderRadius: 2, width: '100%', minHeight: 100 }}>
                <Typography variant="body1" align="center">
                  {currentQuestion || "Loading question..."}
                </Typography>
              </Box>

              {/* Recording Status */}
              <Box sx={{ mt: 3, display: 'flex', gap: 2, alignItems: 'center' }}>
                <Chip
                  icon={isListening ? <MicIcon /> : <MicOffIcon />}
                  label={isListening ? "Listening..." : "Not Recording"}
                  color={isListening ? "error" : "default"}
                  variant={isListening ? "filled" : "outlined"}
                />
                {isProcessing && (
                  <Chip
                    label="Processing Answer..."
                    color="warning"
                    icon={<PlayIcon />}
                  />
                )}
              </Box>
            </CardContent>
          </Card>

          {/* User Video Section */}
          <Card sx={{ flex: 1, minHeight: 400 }}>
            <CardContent sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
              <Typography variant="h6" align="center" gutterBottom>
                Your Video Feed
              </Typography>

              <Box sx={{ flex: 1, display: 'flex', justifyContent: 'center', alignItems: 'center', mb: 2 }}>
                <Webcam
                  ref={webcamRef}
                  audio={false}
                  videoConstraints={webcamConstraints}
                  style={{
                    width: '100%',
                    maxWidth: '400px',
                    borderRadius: '8px',
                    border: '2px solid #ccc'
                  }}
                />
              </Box>

              {/* Controls */}
              <Box sx={{ display: 'flex', gap: 2, justifyContent: 'center' }}>
                <Button
                  variant={isRecording ? "outlined" : "contained"}
                  color={isRecording ? "error" : "primary"}
                  startIcon={isRecording ? <StopIcon /> : <PlayIcon />}
                  onClick={isRecording ? stopRecording : startRecording}
                  disabled={isProcessing}
                  size="large"
                >
                  {isRecording ? "Stop Recording" : "Start Recording"}
                </Button>
              </Box>

              {isProcessing && (
                <Box sx={{ mt: 2 }}>
                  <Typography variant="body2" align="center" sx={{ mb: 1 }}>
                    Analyzing your response...
                  </Typography>
                  <LinearProgress />
                </Box>
              )}
            </CardContent>
          </Card>
        </Box>

        {/* Progress Bar */}
        <Box sx={{ mt: 3 }}>
          <Typography variant="body2" sx={{ mb: 1 }}>
            Interview Progress
          </Typography>
          <LinearProgress
            variant="determinate"
            value={(questionNumber / totalQuestions) * 100}
            sx={{ height: 8, borderRadius: 4 }}
          />
        </Box>
      </Paper>

      {/* End Interview Dialog */}
      <Dialog open={showEndDialog} onClose={() => setShowEndDialog(false)}>
        <DialogTitle>Interview Complete!</DialogTitle>
        <DialogContent>
          <Typography>
            Congratulations! You have completed your AI-powered interview session.
            Your responses are being analyzed and a detailed feedback report will be generated.
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleEndInterview} variant="contained">
            View Results
          </Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default Interview;
